/*  Form Field  */
const Field = ({ label, children, span }) => (
  <div style={{ gridColumn: span ? `span ${span}` : undefined }}>
    <label style={{ display: "block", fontSize: 12, fontWeight: 600, color: "#374151", marginBottom: 4 }}>{label}</label>
    {children}
  </div>
);

const inputStyle = {
  width: "100%", padding: "8px 10px", borderRadius: 6, border: `1px solid ${B.border}`,
  fontSize: 14, outline: "none", boxSizing: "border-box", fontFamily: "inherit",
};

/*  Modal  */
const PropertyModal = ({ open, onClose, onSave, initial }) => {
  const [f, setF] = useState(initial || { ...EMPTY_PROP, id: crypto.randomUUID() });
  const set = (k, v) => setF((p) => ({ ...p, [k]: v }));

  // Reset form when modal opens with new data
  if (open && initial && f.id !== initial.id) setF(initial);
  if (open && !initial && f.id && f.dealId !== "") {
    // only reset if truly re-opening for add
  }

  if (!open) return null;
  return (
    <div style={{ position: "fixed", inset: 0, zIndex: 1000, display: "flex", alignItems: "center", justifyContent: "center", background: "rgba(0,0,0,.45)" }}
      onClick={(e) => e.target === e.currentTarget && onClose()}>
      <div style={{ background: "#fff", borderRadius: 12, padding: 24, width: "90%", maxWidth: 520, maxHeight: "90vh", overflowY: "auto", boxShadow: "0 20px 60px rgba(0,0,0,.2)" }}>
        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: 16 }}>
          <h2 style={{ fontFamily: "'Playfair Display',Georgia,serif", fontSize: 20, margin: 0 }}>{initial ? " Edit" : " Add"} Property</h2>
          <button onClick={onClose} style={{ background: "none", border: "none", fontSize: 22, cursor: "pointer", color: "#888" }}></button>
        </div>
        <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: 12 }}>
          <Field label="Deal ID" span={2}><input style={inputStyle} value={f.dealId} onChange={(e) => set("dealId", e.target.value)} placeholder="1234567" /></Field>
          <Field label="Street" span={2}><input style={inputStyle} value={f.street} onChange={(e) => set("street", e.target.value)} placeholder="123 Main St" /></Field>
          <Field label="City"><input style={inputStyle} value={f.city} onChange={(e) => set("city", e.target.value)} placeholder="Miami" /></Field>
          <Field label="State"><input style={inputStyle} value={f.state} onChange={(e) => set("state", e.target.value)} placeholder="FL" /></Field>
          <Field label="Price"><input style={inputStyle} value={f.price} onChange={(e) => set("price", e.target.value)} placeholder="$1,200,000" /></Field>
          <Field label="Tag">
            <select style={inputStyle} value={f.tag} onChange={(e) => set("tag", e.target.value)}>
              <option value="">None</option>
              <option>Active</option>
              <option>New</option>
              <option>Hot</option>
            </select>
          </Field>
          <Field label="Beds"><input style={inputStyle} type="number" value={f.beds} onChange={(e) => set("beds", +e.target.value)} /></Field>
          <Field label="Baths"><input style={inputStyle} type="number" value={f.baths} onChange={(e) => set("baths", +e.target.value)} /></Field>
          <Field label="Sq Ft"><input style={inputStyle} value={f.sqft} onChange={(e) => set("sqft", e.target.value)} placeholder="3,200" /></Field>
          <Field label="Garage"><input style={inputStyle} type="number" value={f.garage} onChange={(e) => set("garage", +e.target.value)} /></Field>
          <Field label="Basement">
            <select style={inputStyle} value={f.basement} onChange={(e) => set("basement", e.target.value)}>
              <option>Yes</option><option>No</option>
            </select>
          </Field>
          <Field label="Image URL" span={2}>
            <div style={{ display: "flex", gap: 6, alignItems: "center" }}>
              <input style={{ ...inputStyle, flex: 1 }} value={f.image && !f.image.startsWith("data:") ? f.image : (f.image ? "Image uploaded" : "")} onChange={(e) => set("image", e.target.value)} placeholder="https://... or upload " readOnly={f.image?.startsWith("data:")} />
              <label style={{ padding: "8px 14px", borderRadius: 6, border: `1px solid ${B.green}`, background: B.green, color: "#fff", fontSize: 13, fontWeight: 600, cursor: "pointer", whiteSpace: "nowrap", display: "inline-flex", alignItems: "center", gap: 5 }}>
                 Upload
                <input type="file" accept="image/*" style={{ display: "none" }} onChange={(e) => {
                  const file = e.target.files?.[0];
                  if (!file) return;
                  const reader = new FileReader();
                  reader.onload = (ev) => { set("image", ev.target.result); set("imagePos", "center center"); };
                  reader.readAsDataURL(file);
                  e.target.value = "";
                }} />
              </label>
            </div>
            {f.image && (
              <div style={{ marginTop: 8 }}>
                <div style={{ fontSize: 11, fontWeight: 600, color: "#374151", marginBottom: 4 }}>Preview (as it will appear on tile)</div>
                <div style={{ borderRadius: 8, overflow: "hidden", border: `1px solid ${B.border}`, position: "relative" }}>
                  <img src={f.image} alt="Preview" style={{ width: "100%", height: 160, objectFit: "cover", objectPosition: f.imagePos || "center center", display: "block" }}
                    onError={(e) => { e.target.src = "https://images.unsplash.com/photo-1560518883-ce09059eeffa?w=800&h=450&fit=crop"; }} />
                </div>
                <div style={{ marginTop: 6, display: "flex", alignItems: "center", gap: 8, flexWrap: "wrap" }}>
                  <span style={{ fontSize: 11, color: B.muted, fontWeight: 500 }}>Position:</span>
                  {[
                    { label: " Top", value: "center top" },
                    { label: " Center", value: "center center" },
                    { label: " Bottom", value: "center bottom" },
                    { label: " Left", value: "left center" },
                    { label: " Right", value: "right center" },
                  ].map(opt => (
                    <button key={opt.value} onClick={() => set("imagePos", opt.value)}
                      style={{ padding: "3px 10px", borderRadius: 4, fontSize: 11, fontWeight: 600, cursor: "pointer", border: `1px solid ${(f.imagePos || "center center") === opt.value ? B.green : B.border}`, background: (f.imagePos || "center center") === opt.value ? B.green : "#fff", color: (f.imagePos || "center center") === opt.value ? "#fff" : "#555" }}>
                      {opt.label}
                    </button>
                  ))}
                </div>
              </div>
            )}
          </Field>
          <Field label="ARV"><input style={inputStyle} value={f.arv} onChange={(e) => set("arv", e.target.value)} placeholder="$500,670" /></Field>
          <Field label="Repairs"><input style={inputStyle} value={f.repairs} onChange={(e) => set("repairs", e.target.value)} placeholder="$100,548" /></Field>
          <Field label="Profit Margin"><input style={inputStyle} value={f.profit} onChange={(e) => set("profit", e.target.value)} placeholder="$75,000" /></Field>
          <Field label=" End Date"><input style={inputStyle} type="date" value={f.endDate} onChange={(e) => set("endDate", e.target.value)} /></Field>
          <Field label="View Property URL"><input style={inputStyle} value={f.viewUrl} onChange={(e) => set("viewUrl", e.target.value)} placeholder="https://..." /></Field>
          <Field label="Make Offer URL"><input style={inputStyle} value={f.offerUrl} onChange={(e) => set("offerUrl", e.target.value)} placeholder="https://..." /></Field>
          <Field label="Description" span={2}>
            <textarea style={{ ...inputStyle, minHeight: 70, resize: "vertical" }} value={f.description}
              onChange={(e) => set("description", e.target.value)} placeholder="A stunning property..." />
            {(() => {
              const max = 190;
              const remaining = max - (f.description?.length || 0);
              const isOver = remaining < 0;
              return (
                <div style={{ display: "flex", justifyContent: "flex-end", marginTop: 4, fontSize: 11 }}>
                  <span style={{ color: isOver ? B.red : B.green, fontWeight: 600 }}>
                    {f.description?.length || 0} / {max}
                  </span>
                </div>
              );
            })()}
          </Field>
        </div>
        <div style={{ display: "flex", justifyContent: "flex-end", gap: 10, marginTop: 18 }}>
          <button onClick={onClose} style={{ padding: "8px 20px", borderRadius: 6, border: `1px solid ${B.border}`, background: "#fff", fontSize: 14, cursor: "pointer" }}>Cancel</button>
          <button onClick={() => { onSave(f); onClose(); }}
            disabled={!f.dealId || !f.price}
            style={{ padding: "8px 20px", borderRadius: 6, border: "none", background: B.green, color: "#fff", fontSize: 14, fontWeight: 600, cursor: "pointer", opacity: (!f.dealId || !f.price) ? 0.5 : 1 }}>
            {initial ? "Save Changes" : "Add Property"}
          </button>
        </div>
      </div>
    </div>
  );
};

